import { Table } from "react-bootstrap";
import { Link } from "react-router-dom";

function ProductList({ products, title, handleDelete }) {
    console.log(products);

    return (
        <div>
            <h2>{title}</h2>
            <Table striped bordered hover>
                <thead>
                <tr>
                    <th>Name</th>
                    <th>Email</th>
                </tr>
                </thead>
                <tbody>
                {products.map((prod) => (
                    <tr key={prod.ItemName}>
                        <td>{prod.ItemName}</td>
                        <td>{prod.ItemSales}</td>
                        <td>
                            <Link to={`/product/${prod.ItemName}`}>Show {prod.ItemName}</Link>
                        </td>
                    </tr>
                ))}
                </tbody>
            </Table>
        </div>
    );
}

export default ProductList;
